const Moves = (props) => {
    const moves = props.moves.map(move => {
        const version = move.version_group_details.map(v => {
            console.log(v)
        })


        return (
            <div>
                Name: {move.move.name} 

                <br />
                Learn At: {move.version_group_details[0].level_learned_at}
            </div>
        )
    })

    return (
        <div>
            {moves}
        </div>
    )
}

export default Moves
